const input = [
    "",
    "",
    "",
    "",
    ""
]

let password = ""

var x = 0
var y = 2
var map = [
    [' ', ' ', '1', ' ', ' '],
    [' ', '2', '3', '4', ' '],
    ['5', '6', '7', '8', '9'],
    [' ', 'A', 'B', 'C', ' '],
    [' ', ' ', 'D', ' ', ' '],
]

for(let i = 0; i < input.length; i++){
    for(let inst_ind = 0; inst_ind < input[i].length; inst_ind++){
        switch(input[i][inst_ind]){
            case 'U':
                y = Math.max(y-1, 0)
                if(map[y][x] == ' ') y++;
                break;
            case 'D':
                y = Math.min(y+1, 4)
                if(map[y][x] == ' ') y--;
                break;
            case 'L':
                x = Math.max(x-1, 0)
                if(map[y][x] == ' ') x++;
                break;
            case 'R':
                x = Math.min(x+1, 4)
                if(map[y][x] == ' ') x--;
                break;
        }
    }
    
    password += map[y][x]
}

console.log(password)